    def __init__(self, lcd, red=False):
        self.sprite_l = liblcd.Sprite(lcd, 22, 45)
        self.sprite_r = liblcd.Sprite(lcd, 22, 45)
        self.sprite_cup = liblcd.Sprite(lcd, 18, 24)
        self.x = random.randrange(180, 300)
        self.flag_hit = False
        if red:
            self.sprite_l.setBuffer(self.RED_FLAG_1)
            self.sprite_r.setBuffer(self.RED_FLAG_2)
